The car brand Dodge is similar to:
 Toyota, BMW and Ford in terms of its scale. It's been around since the late 1980s, but it has been steadily expanding its line-up.

The Dodge Challenger is the largest production car in the world. It's also the most expensive to produce. It's about $100,000, which is roughly five times the price of the latest Ferrari.

Here's the full press release:

Dodge Challenger and Challenger S model debut in the U.S.

Dodge's newest production car, the Challenger S, will be the first production model to break into the U.S. market.

The new Challenger S is a compact, four-door, three-passenger vehicle that is the first production model to break into the U.S. market. As the world's largest production car, the Challenger S is designed to offer a unique blend of performance, luxury and value.

This compact, four-door, three-passenger vehicle is available in three trim levels: the Challenger S, the Challenger S Plus and the Challenger S Premium. The full list of features includes:

Full-size front seats with reclining and adjustable backrests;

Dual front and rear-facing camera cameras;

Dual front and rear-facing audio speakers;

Power steering with a paddle shifter;

Aesthetically stunning interior with leather seating surfaces;

Flat-panel door panels;
